import React from 'react';
import styled from 'styled-components';

const StyledSlideOne = styled.div`
  position: relative;

  .cars-group {
    position: absolute;
    #silver-car {
      height: 18vh;
    }
    #white-car-1 {
      height: 18vh;
    }
    #white-car-2 {
      height: 18vh;
    }
  }
  .image-wrapper {
    position: absolute;
    top: 40px;
    right: 80px;
    display: inline-block;
    height: 80vh;

    img {
      height: 100%;
      border: black solid 3px;
      border-radius: 30px;
    }
  }
  .background-top {
    position: relative;
    background: #FAC943;
    width: 100%;
    height: 80vh;
  }
  .background-bottom {
    position: relative;
    background: #FFFFFF;
    width: 100%;
    height: 20vh;
  }
`;

function SlideOne() {
  return (
    <StyledSlideOne>
      <div className='background-top'/>
      <div className='background-bottom' />
      <div className='cars-group'>
        <img id='silver-car' src='images/silver_car.png' alt='silver sports car' />
        <img id='white-car-1' src='images/white_car_left.png' alt='white sports car' />
        <img id='white-car-2' src='images/white_car_right.png' alt='white sports car' />
      </div>
      <div className='image-wrapper'>
        <img src='images/app_screen_4.png' alt='mobile device with Eleanor app'/>
      </div>
    </StyledSlideOne>
  );
}

export default SlideOne;
